const FetchDataEmoji = async () => {
  const url = 'https://ritekit-ritekit-v1.p.rapidapi.com/emoji/suggestions';
  const options = {
    method: 'GET',
    headers: {
      'X-RapidAPI-Key': '12eaa2c047msh237261d4664f961p17b89djsn90feffa1c8d3',
      'X-RapidAPI-Host': 'ritekit-ritekit-v1.p.rapidapi.com',
    },
  };

  try {
    const response = await fetch(url, options);
    const result = await response.text();
    console.log(result);
  } catch (error) {
    console.error(error);
  }
};


export default FetchDataEmoji;
